(87,	'15% Off Dental Treatments',	'Palmyra Dental Clinic in Jumeira Lakes Towers is a private Dental Clinic in United Arab Emirates, Dubai and our dentists, dental therapists, endodontists, orthodontists, hygienists, nursing and support staff work as a team to offer a full range of cosmetic dentistry and general dental treatments and provide oral hygiene advice to enable our patients to maintain a beautiful smile.\r\n\r\nPalmyra dentists are offering scaling and polishing with stain removal for 150AED and Fluoride for 100AED. All other dental treatments have a15% discount.\r\n\r\nBe sure to request Dr Lina if you are more comfortable with a female dentist.',	8,	'gDJn55nmBHLOKAeTpfiSgniW5gA0qrxAgOwNCMSe.png',	77,	'Present ID to redeem discount',	'2021-01-17 05:30:02',	1,	'2021-01-17 05:30:02',	'2021-02-18 06:35:32'),
(88,	'Free Trail Session',	'Infinite SKI is a place for learning, training and having fun all in the comfort of a pleasantly warm environment. The 2 state-of-the-art Maxxtracks indoor ski slopes will progress your ski or snowboard skills faster than ever before. At infinite SKI, the speed of the belt and the angle of the slope are adjustable to suit the skill of every skier.\r\n\r\nFor all TDG, Infiniti Ski are offering a free trail for Skiing/Snowboarding, Fitness Classes or Hip Hop Dance.\r\n\r\nPlease note, all members must sign their standard waiver.',	7,	'mRtmgjDp9T7U2uAq397zGzcm3fTlmZLdkOwQBy4r.png',	53,	'Present ID to redeem discount',	'2021-01-17 06:24:43',	1,	'2021-01-17 06:24:43',	'2021-02-18 06:37:18'),
