(102,	'10% Off Everything',	'FIT BOX is a stylish, compact home and travel workout solution aimed at women of all ages and levels of strength and fitness. In the box, you will find all the tools you need to work towards your health and fitness goals in style along with a 2 week kick-starter workout program designed by Personal trainer and founder Jen Towers. There is also access to other workout programs on the website, personal training with Jen and empowering group classes.\r\n\r\nFIT BOX are offering 10% off everything to TDG members.',	14,	'WL49B0xCT6WwNMlMmoa8bokONorx34MGbrpFBopu.jpeg',	41,	'Use code TDG10 at checkout',	'2021-01-20 11:06:12',	1,	'2021-01-20 11:06:12',	'2021-02-18 07:06:05'),
(103,	'$10 Off The Program',	'Almost Plant Based 21-Day Weight-Loss Challenge provides you with clear guidelines & a schedule how to lose weight and educates you on the right foods to eat so the weight stays down. You will own your health again. Start anytime and get lifetime access to videos, voice over presentations, 200+ recipes and more. They are also certified in Nutrition Science by Stanford University.\r\n\r\nAlmost Plant Based are offering $10 off their program. Please note, their website charges in USD.',	14,	'9U1ne7Dktj91nNyB3mx9L5obvtqK30qBOvRP3Bno.png',	78,	'Use code TDG10$OFF at checkout',	'2021-01-20 11:42:34',	1,	'2021-01-20 11:42:34',	'2021-02-18 07:09:16'),
(104,	'10% Off Cakes',	'Cake Social is a boutique cake and dessert shop based in Dubai that promises to make every moment sweeter. Along with your everyday cakes and bakes, they specialize in customized 3D cakes where the words stylish and delicious are inseparable. At Cake Social, they believe people should celebrate events, moments, and life as often as possible. Their specialists are available every day to help our ‚ÄúSocials‚Äù realize their vision. You dream it, they bake it!\r\n\r\nCake Social are offering a 10% discount on non-seasonal products with orders above AED 100 to all TDG members.\r\n\r\nAll customized cakes require 1 to 3 days prior booking subject to confirmation. All orders after 7.00 pm are considered as the next day.',	13,	'scU1reFKZmCyLqXuy15aeUt1CcTZHfD9eqDxysv5.png',	80,	'Present ID to redeem discount',	'2021-01-21 06:19:38',	1,	'2021-01-21 06:19:38',	'2021-02-18 07:15:18'),
