(106,	'Special Discount',	'No mess, no stress! The Movers DXB help people and businesses move their goods from one place to another. They offer all-inclusive services for relocation like packing, loading, moving, unloading, unpacking, arranging of items to be shifted. Additional services may include cleaning services for houses, offices or warehousing facilities. They are specialized in providing quality-oriented services. They have well experienced packers & movers to provide best services.\r\n\r\nThe Movers DXB are offering a special discount to all TDG members. Please quote TDG at the time of booking.',	13,	'uQDLNY8MD5JEvP6Ks8LpjNuTGJrfhkezRyN2usLQ.png',	81,	'Present ID to redeem discount',	'2021-01-21 06:34:05',	1,	'2021-01-21 06:34:05',	'2021-02-18 07:23:02'),
