(109,	'Happy Hour All Night',	'Please note this venue is currently closed.\r\n\r\nExperience the unique drinking culture of Japan and explore its 100-year-old history at Nippon Bottle Company, where the legacy lives on. Discover the unmistakable textures and blends of Japanese beers and whiskies for a journey of flavours.\r\n\r\nNippon Bottle Company are offering an exclusive Ladies Night for all TDG members, Saturday\'s through Monday\'s.\r\n\r\nHappy hour all night @ AED 29 per drink (house beverages only)',	5,	'zeRXsbnZnQp9mdRhLfJg5mxZ0RMjSIbA4UJuTZgA.png',	95,	'Present ID to redeem discount',	'2021-01-21 12:33:56',	1,	'2021-01-21 12:33:56',	'2021-02-18 07:28:55'),
