(146,	'10% Off Purchases',	'Shea Good is a luxury shea butter brand that is created from raw organic African shea butter which is renowned for its anti-inflammatory and healing properties amongst many other benefits. Shea Good have taken a traditional product, which has been used for centuries, and melodically infused it with essential oils and fragrances to produce distinctive scents. Their focus is not only on the outer but more significantly the inner, and it is of fundamental importance to create their products as naturally as possible. They have created this product with only you in mind, wanting you to look, smell and feel as luxurious as their product. \r\n\r\nShea Good are offering 10% off full price items to all TDG members.',	3,	'8CDYECyzkc1tKUtmF0gpNVZl3XM4lzSNiAM14wc6.png',	108,	'Use code ThatDG10 at checkout',	'2021-01-27 09:20:54',	1,	'2021-01-27 09:20:54',	'2021-02-18 10:14:16'),
