(155,	'20% Off Meal Plans',	'This is Kcal; a company that lives for making healthy eating easy, accessible and above all, delicious. With tailor made meal plans designed by an expert nutrition team, Kcal delivers everything anyone could need to be the best they can be.\r\n\r\nFor over a decade Kcal have been at the forefront of helping the people of the UAE to make simple, sustainable lifestyle changes so they can look and feel better than ever. Whether it\'s losing weight and keeping it off, or simply hitting their personal fitness goals, Kcal has the answer and it\'s easy.\r\n\r\nThe daily deliveries of three meals and two snacks are crafted by professional chefs every morning before being carefully delivered in specially design chiller bags that are more than just functional; they are a symbol of health, wellness and good taste.\r\n\r\nThe Kcal solution gives everyone more time to live their best life and allows them to stop worrying about what to eat.\r\n\r\nIt\'s time to taste life. It\'s time for Kcal.\r\n\r\nKcal are offering 20% off meal plans to all TDG members. Terms and conditions apply to the offer.',	14,	'I79UHIXe76TXegCUA2XEylZXQzq5j6GaO045AyKZ.png',	119,	'Use code TDG20 at checkout',	'2021-02-03 07:15:37',	1,	'2021-02-03 07:15:37',	'2021-02-23 12:00:58'),
