(230,	'300 AED Off and 10% Off Crates',	'The Pet Shop Relocations understands the needs of their valued customers and the welfare of their pets. Offering a personalised service tailored to you and your pets relocation needs, their dedicated team is flying pets safely all over the world.   \r\n\r\nThe Pet Shop are offering 200 AED off (door to door relocations), and 100 AED off (documents only) for all TDG members. \r\n\r\nThe Pet Shop are also offering 10% off crates, when using their relocation service. \r\n\r\nContact number is available 10‚Äì5pm week days. Please WhatsApp for all initial enquiries.',	13,	'IMByrGEoNrgdu6J9JK4zuTNaYDZ3DvkGXQGIX2qE.png',	163,	'Present ID to redeem discount',	'2021-03-14 08:00:40',	1,	'2021-03-14 08:00:40',	'2021-03-14 11:02:35'),
(231,	'15% Off Cuts and Colour',	'Ted Morgan Hair Salon is an Irish owned Ladies Salon located in Dubai‚Äôs Motor City. At Ted Morgan, they are obsessed with the quality of cut and finish. They are always striving for a balance between creativity and technical perfection coupled with a personal focus on each individual client. To ensure that a five star service is achieved every time, their stylists have at least seven years or more experience in the industry. Their stylists come from Ireland and the UK and all share a passion for the art of hairdressing and each of them possess a wealth of knowledge and skill, which is implemented daily at Ted Morgan Hair. They want their clients to leave feeling and looking great. They believe that attention to detail and understanding their client is the key to a successful salon experience.\r\n\r\nTed Morgan Hair are offering 15% off on cuts and colouring services to all TDG members. Discounts exclude treatments, toners, hair extensions and retail products. Discount is not valid in conjunction with any other promotions or offers.',	2,	'fA38GuUrkkc1xYhuHToj9VOtf1J7ccKnW2n5xMm7.jpeg',	164,	'Present ID to redeem discount',	'2021-03-14 12:04:25',	1,	'2021-03-14 12:04:25',	'2021-03-14 12:14:45'),
