(233,	'Spa-cation',	'Treat yourself to a day of relaxation and pampering. Upon availing a 90-minute body massage, indulge in a healthy breakfast or lunch Bento Box and luxuriate at the outdoor pool all day.\r\n\r\nRaffles Spa are offering a free upgrade to a relaxing 90-minute massage to all TDG members - The standard price is 450 AED for a 60-minute massage.\r\n\r\nRaffles Spa is open from 10am to 9pm and the swimming pool from 8am to 8pm. The offer is available Sunday to Thursday.',	15,	'jHxyafT37wqg1V8kak0Kb0n3RczkJkaXgIc5IJ6b.png',	165,	'Present ID to redeem discount',	'2021-03-18 07:02:05',	2,	'2021-03-18 07:02:05',	'2021-03-21 11:16:51'),
(234,	'25% Off Penguin Cove & Nursery Experience',	'Dubai Aquarium & Underwater Zoo is an integral part of The Dubai Mall‚Äôs diverse entertainment portfolio. Located strategically in the centre of the Mall, Dubai Aquarium is one of the largest indoor aquariums of its kind in the world at 51m long, 20m wide and 11m deep. With the capacity to hold 10 million litres of water, Dubai Aquarium illuminates the marvels of the ocean floor and showcases one of the most diverse collections of aquatic life worldwide. Dubai Aquarium has thousands of aquatic animals, representing several hundred-marine species. \r\n\r\nUnderwater Zoo, located on Level 2, offers an interactive approach to educating guests of all ages on the ecology and sustainability of marine life. The journey consists of three ecological zones: Rainforest, Rock Pool Coastline and UAE Night Creatures, where a variety of aquatic animals are featured including Crocodiles, Piranhas, Giant Spider Crabs, Otters, Water Rats, Sea Horses and Sea Jellies amongst others.\r\n\r\nT&C‚Äôs\r\nValid for up to 4 guests\r\nNot valid on public holidays\r\nPayment at admissions counter by cash or credit card\r\nValid weekends and weekdays\r\nGlass Bottom Boat Ride not available for pregnant guests and children below 3 years of age\r\nChildren under 3 years of age free of charge\r\nChildren under 16 years of age must be accompanied by an adult (16+ years old)\r\n\r\nConditions:\r\nOpening hours: 10:00 to 22:00 (Sun-Wed), last admission: 21:00. Weekends: ‚ÄúThur-Sat‚Äù 10:00 to 23:00, last admission: 22:15. Timings are subject to change. \r\nDubai Aquarium & Underwater Zoo is not responsible for lost, misplaced or stolen tickets.\r\nDubai Aquarium & Underwater Zoo may change operating hours or close temporarily due to refurbishing, capacity, inclement weather or special events, and may otherwise be discounted without notice and without liability to the owner.\r\nTicket does not entitle holder to non-complimentary services or provisions within Dubai Aquarium & Underwater Zoo.\r\nRe-admission to Dubai Aquarium & Underwater Zoo is not allowed.\r\nTickets holder may be refused entry if, in the reasonable opinion of the staff, the presence of the holder may pose risk to the safety of tickets holders, and/or affect the enjoyment of others within Dubai Aquarium & Underwater Zoo and/or affect the normal operation of Dubai Aquarium & Underwater Zoo. \r\nManagement reserves the right to refuse admission. \r\nAll persons entering the venue are subject to the rule and regulations as set by the management. \r\nTickets are non-refundable and non-exchangeable. \r\nChildren under 3 years of age and pregnant women are not permitted to ride the Glass-Bottom Boats for safety reasons. \r\nChildren under 16 years of age must be accompanied by an adult. \r\nValid voucher must be presented.\r\nNew safety measures, https://www.thedubaiaquarium.com/en/covid19/',	7,	'nigh0MpSZ5C396ZcWaCnhzHWvVPQmgq1wzTnUBze.png',	88,	'Present ID to redeem discount',	'2021-03-21 06:21:10',	1,	'2021-03-21 06:21:10',	'2021-03-21 08:54:23'),
(235,	'25% Off Ultimate Experience',	'Dubai Aquarium & Underwater Zoo is an integral part of The Dubai Mall‚Äôs diverse entertainment portfolio. Located strategically in the centre of the Mall, Dubai Aquarium is one of the largest indoor aquariums of its kind in the world at 51m long, 20m wide and 11m deep. With the capacity to hold 10 million litres of water, Dubai Aquarium illuminates the marvels of the ocean floor and showcases one of the most diverse collections of aquatic life worldwide. Dubai Aquarium has thousands of aquatic animals, representing several hundred-marine species. \r\n\r\nUnderwater Zoo, located on Level 2, offers an interactive approach to educating guests of all ages on the ecology and sustainability of marine life. The journey consists of three ecological zones: Rainforest, Rock Pool Coastline and UAE Night Creatures, where a variety of aquatic animals are featured including Crocodiles, Piranhas, Giant Spider Crabs, Otters, Water Rats, Sea Horses and Sea Jellies amongst others.\r\n\r\nT&C‚Äôs\r\nValid for up to 4 guests\r\nNot valid on public holidays\r\nPayment at admissions counter by cash or credit card\r\nValid weekends and weekdays\r\nGlass Bottom Boat Ride not available for pregnant guests and children below 3 years of age\r\nChildren under 3 years of age free of charge\r\nChildren under 16 years of age must be accompanied by an adult (16+ years old)\r\n\r\nConditions:\r\nOpening hours: 10:00 to 22:00 (Sun-Wed), last admission: 21:00. Weekends: ‚ÄúThur-Sat‚Äù 10:00 to 23:00, last admission: 22:15. Timings are subject to change. \r\nDubai Aquarium & Underwater Zoo is not responsible for lost, misplaced or stolen tickets.\r\nDubai Aquarium & Underwater Zoo may change operating hours or close temporarily due to refurbishing, capacity, inclement weather or special events, and may otherwise be discounted without notice and without liability to the owner.\r\nTicket does not entitle holder to non-complimentary services or provisions within Dubai Aquarium & Underwater Zoo.\r\nRe-admission to Dubai Aquarium & Underwater Zoo is not allowed.\r\nTickets holder may be refused entry if, in the reasonable opinion of the staff, the presence of the holder may pose risk to the safety of tickets holders, and/or affect the enjoyment of others within Dubai Aquarium & Underwater Zoo and/or affect the normal operation of Dubai Aquarium & Underwater Zoo. \r\nManagement reserves the right to refuse admission. \r\nAll persons entering the venue are subject to the rule and regulations as set by the management. \r\nTickets are non-refundable and non-exchangeable. \r\nChildren under 3 years of age and pregnant women are not permitted to ride the Glass-Bottom Boats for safety reasons. \r\nChildren under 16 years of age must be accompanied by an adult. \r\nValid voucher must be presented.\r\nNew safety measures, https://www.thedubaiaquarium.com/en/covid19/',	7,	'50waDxM2i3CwY01qBJGhrICQaMWeaPZSVBbnQg1V.png',	88,	'Present ID to redeem discount',	'2021-03-21 06:26:14',	1,	'2021-03-21 06:26:14',	'2021-03-21 08:54:45'),
(236,	'25% Off General Admission',	'Located on the ground floor of the mall next to The Waterfall, the Olympic-size Dubai Ice Rink has become a social hotspot, appealing to the entire spectrum of the society, both to young and old alike. Dubai Ice Rink has enhanced its range of facilities to define its credentials as the must-visit leisure destination in the city. Assuring unlimited fun for skating enthusiasts and for visitors, it offers several unmatched features for youth including Dubai Ice Rink Skating Academy (DIRSA) and a full programme of coaching from basic learn to skate to advanced figure skating.\r\n\r\nIn addition to skating sessions and training programmes, Dubai Ice Rink has enhanced its lifestyle appeal with cool D.J. nights and snow fall sessions to add to the joy for youngsters and young at heart. The coolest events venue in the city, Dubai Ice Rink also serves as an ideal setting for celebratory events or friendly get-togethers.\r\n\r\nT&Cs\r\nValid for up to 4 guests\r\nNot valid on public holidays\r\nPayment at admissions counter by cash or credit card\r\nValid weekends and weekdays\r\n\r\nConditions:\r\nOpening hours: 10:00 to 22:00 (Sun-Wed), last admission: 21:00. Weekends: ‚ÄúThu-Sat‚Äù 10:00 to 00:00. Timings are subject to change\r\nPlease arrive at least 15 minutes earlier to get ready before the session. Please wear warm and comfortable clothing suitable for exercising in thick, long socks and gloves if possible.\r\nAdditional personal protective equipment is available for purchase at the Skate Shop. \r\nThere are no refunds in whole or in part which will be allowed under any circumstances.\r\nDubai Ice Rink reserves the right to reschedule sessions and session‚Äôs timings without prior notice.\r\nValid voucher must be presented.\r\nIf you have any questions, please send an email to dubaiicerink@emaar.ae or call us at +971 4 4485111.\r\nNew safety measures, https://www.dubaiicerink.com/en/covid19/index.aspx',	7,	'dkaOaiVJfYFqhMYtBbOHnitTLhearo9pXNVaKbZN.png',	89,	'Present ID to redeem discount',	'2021-03-21 06:57:23',	1,	'2021-03-21 06:57:23',	'2021-03-21 08:53:51'),
(237,	'25% Off Entry',	'KidZania¬Æis an activity-packed indoor city where learning and play collide for day out your children will never forget. The 7,000m¬≤ scaled replica of a real city combines entertainment and education, with over 60 real-life activities for children aged 4-16. Children will discover and learn all about different jobs through exciting role-play, while developing decision-making, teamwork, creativity and social skills in ways that can‚Äôt be taught in a classroom.\r\n\r\nLocated Level 2, The Dubai Mall. \r\n\r\nT&Cs\r\nValid for up to 4 guests\r\nNot valid on public holidays\r\nPayment at admissions counter by cash or credit card\r\nValid weekends and weekdays\r\n\r\nOpening hours: 11:00 to 20:00 (Sun-Wed), last admission: 19:00. Weekends: ‚ÄúThur-Sat‚Äù 12:00 to 2100, last admission: 8:00pm. Timings are subject to change.',	7,	'jLSwLtbq3SEtQIXwMFEPWxBbr2LI4rYizimbP80m.png',	85,	'Present ID to redeem discount',	'2021-03-21 07:16:58',	1,	'2021-03-21 07:16:58',	'2021-03-21 08:53:00'),
(238,	'25% Off Entry',	'Buildings, city blocks, plazas and streets for children to play at being adults, with 60 different real-life professions available for children with big dreams. This is what KidZania is all about: an interactive city made for children and ran by them, a city that combines inspiration, fun and learning through realistic role-play. \r\n\r\nThis award-winning edutainment concept is now available in Abu Dhabi with the opening of Kidzania Abu Dhabi at Yas Mall. \r\nKidZania Abu Dhabi spans over 5,500 square meters where you can find children‚Äôs versions of a hospital, fire station, beauty salon, bank, oil company, radio and TV station, supermarket, pizzeria and more, all made even more realistic with local industry partners empowering kids and allowing them to find out what it‚Äôs like to work in all of them. From television anchors reading the news, to police officers performing detective work and chefs cooking up tasty food, role-playing activities will introduce them to different careers in a fun and interactive way. \r\n\r\nAt KidZania Abu Dhabi, children ages 1 to 16 have the opportunity of having adult-like experiences while assuming the role of firemen, construction workers, police officers, and fashion designers, among others. Not only that, kids are also made aware of the importance of earning Kidzos (KidZania‚Äôs currency), and managing their earnings, preparing them to be responsible future adults. In addition, visitors will find Food & Beverage, Merchandising and Media dedicated locations, creating a broad offering of urban environments, establishments and activities to enjoy the complete KidZania experience. \r\n\r\nT&Cs\r\nValid for up to 4 guests\r\nNot valid on public holidays\r\nPayment at admissions counter by cash or credit card\r\nValid weekends and weekdays\r\n\r\nConditions;\r\nOpening hours: 13:00 to 20:00 (Sun-Wed), last admission: 19:00. Weekends: ‚ÄúThur-Sat‚Äù 12:00 to 21:00. Last admission: 20:00. Timings are subject to change.\r\nSwapping the bracelets is not allowed.\r\nAccompanying adult for the children below 120 cm has to be present with them in park during the duration of the stay.\r\nPlease note that Adults are not permitted into KidZania unless accompanying a child.\r\nAll day general adult admission age limit: 17 to 64 years old.\r\nRe-admission inside Kidzania is not allowed. \r\nOnce admitted, children cannot exit temporarily. Lost Kidzos, cheques or vouchers are non-refundable.\r\nEntry fee is non-refundable.\r\nOperating hours are subject to change without prior notice.\r\nOutside food and beverages are not allowed within merchant\'s premises. \r\nKidZania Management reserves the right to refuse the admission of the ticket holder, if his or her entry may prove detrimental towards the ambience, safety, security and operations of the facility.\r\nValid on the deal option purchased only.\r\nOther terms and conditions apply\r\nNew safety measures, https://dubai.kidzania.com/en-ae/pages/covid_updates',	7,	'WvqEo6yOgHxZv3nJO05hRi3vfP2GicbmOfmmRgjU.png',	86,	'Present ID to redeem discount',	'2021-03-21 07:22:41',	1,	'2021-03-21 07:22:41',	'2021-03-21 08:53:20'),
(239,	'25% Off',	'Dig It is an incredible play space based on a real life construction site! Kids between 3 to 12 will be able to dig, move, tunnel, climb, build and create. They will also drive a remote-controlled truck, pilot a mechanical arm, create their Lego racer, and even try out a full-size digger!\r\n\r\nTons of great workshops are offered every month to test the little digger‚Äôs creative and artistic side. Potential workshop activities include slime-making, paper bag craft, pasta art, clay activities, cookie and cupcake decorating, sand art, jewellery making, tie-dye and more! \r\n\r\nA themed party room is also available with special birthday party packages to choose from, as well as a caf√© where parents can relax and watch their kids play and learn.\r\n\r\nT&Cs\r\nValid on Stay & Dig and Drop & Dig (1.5hr) tickets\r\nValid for up to 4 guests\r\nNot valid on public holidays\r\nPayment at admissions counter by cash or credit card\r\nValid weekends and weekdays\r\n\r\nConditions;\r\nOpening hours: 10:00 to 22:00 (Sun-Wed), last admission: 21:00. Weekends: ‚ÄúThur-Sat‚Äù 10:00 to 20:00, last admission: 19:00. Timings are subject to change.\r\nLocation: Level 2 The Springs Souk (Next to Reel Cinemas) Springs Community, Dubai, UAE\r\nKids under2 go free, if accompanied by paying parent/guardian- AED 40\r\nOnly kids 3 years & Above are eligible for the Drop & Dig admission tickets.\r\nSocks are required in the play zone.\r\nEntry fee is non-refundable.\r\nOther terms and conditions apply\r\nNew safety measures, https://www.digitdubai.com/dig-it-social-commitment/',	7,	'dR6iVnqIVD61Uf3l93MBRcw8u1pCSZQ1Om1AserR.png',	91,	'Present ID to redeem discount',	'2021-03-21 07:27:01',	1,	'2021-03-21 07:27:01',	'2021-03-21 08:52:31'),
(240,	'25% Off Double Session',	'It is the latest generation of electric- go karts, providing amateurs and experienced drivers with the ultimate driving experience! Ekart Zabeel is the perfect place for a challenge with friends, a fun family activity, or a memorable afternoon, with your coworkers for the perfectly organised corporate event.\r\n\r\nT&CsValid for up to 4 guests\r\nNot valid on public holidays\r\nPayment at admissions counter by cash or credit card\r\nValid weekends and weekdays\r\n\r\nConditions:\r\nOpening hours: 14:00 to 22:00, (Sunday-Wednesday), 12:00 to 00:00, (Thursdays-Saturdays). Timings are subject to change.\r\nBe at least 14 years old, 140 cm tall and weigh less than 120 kgs.\r\nWear enclosed footwear. Make sure to wear racing suits over their clothes with loose clothing tucked inside.\r\nEnsure face and/or head covers provided are worn under their helmet to maintain hygiene.\r\nNotify management of any pre-existing health conditions, including any physical limitations, or medical conditions including but not limited to, neck weakness, back weakness, broken bones, heart conditions, nervous disorders, motion sickness, epilepsy or if pregnant.\r\nValid voucher to be presented at the admission counter\r\nNew safety measures, http://www.ekartzabeel.ae/covid-19.html',	7,	'MXhg3ykA1qLYd0FaAEaEvcHD8sQ7Ew2k54Cvduzh.png',	92,	'Present ID to redeem discount',	'2021-03-21 07:32:28',	1,	'2021-03-21 07:32:28',	'2021-03-21 08:52:04'),
(241,	'25% Off Super 7 Pass',	'A first-of-its-kind attraction for the Middle East, VR Park Theme Park is centered on the concept of ‚Äòshared escapism‚Äô, with an unprecedented breadth of rides, experiences and games to suit the whole family. The theme park is designed to ‚ÄòChallenge Reality‚Äô, blurring the lines between perception and reality through unforgettable and mind-blowing experiences, spanning wholly immersive rides, interactive games and educational journeys.\r\n\r\nSet across two levels, VR Park offers attractions to suit all ages and interests, including adrenalin, horror, tranquility and more; including multi-player experiences, allowing visitors to interact with one another and live the experience with family and friends.\r\n#ChallengeReality\r\n\r\nT&Cs\r\nValid for up to 4 guests\r\nNot valid on public holidays\r\nPayment at admissions counter by cash or credit card\r\nValid weekends and weekdays\r\n\r\nConditions\r\nOpening hours: 12:00 to 22:00 daily. Timings are subject to change.\r\nGuests must meet all height, health and age restrictions as indicated at all our attractions, rides and games\r\nGuests with certain health conditions are advised not to experience certain attractions, rides and games. Specific warnings are posted at each location\r\nFor their safety, expectant mothers are advised not to ride our attractions and do so at their own risk\r\nChildren must be supervised by an adult or guardian at all times\r\nGuests must follow all posted and verbal safety instructions provided by VR Park team members\r\nFood and beverages may not be brought onto the rides and attractions\r\nVR Theme Park reserves the right to temporarily close certain attractions, rides or games for purposes of maintenance without prior notice or any compensation whatsoever\r\nGuests are advised to not leave their valuables or personal belongings unattended. VR Theme Park will not be held responsible or liable for any lost, stolen or damaged property\r\nManagement reserves the right to refuse admission or eject a valid ticket holder, if in the team member‚Äôs reasonable opinion, the ticket holder may pose a risk to the safety of others and or affect their enjoyment within VR Theme Park and/or the normal operations of VR Theme Park.\r\nThe Management accepts no liability and is fully and effectively indemnified by the ticket holder at all times against any liability which includes but is not limited to losses, costs, claims, demands, actions, damages, legal and other professional fees and expenses.\r\nNew safety measures, https://www.vrparkdubai.com/Home/Covid19',	7,	'bmp3BQCBDns8gnyEpjsi9Iyfau8FboQgJocyMdKX.png',	90,	'Present ID to redeem discount',	'2021-03-21 07:36:13',	1,	'2021-03-21 07:36:13',	'2021-03-21 07:36:13'),
(242,	'25% Off Dine In - Full Package',	'Reel Cinemas welcomes moviegoers to take part in the most distinctive cinematic experience in Dubai, ensuring the ultimate visual experience for an overall unparalleled cinematic journey with every visit, no matter where you are seated.\r\n\r\nT&Cs\r\nValid for up to 4 guests\r\nNot valid on public holidays\r\nPayment at admissions counter by cash or credit card\r\nValid weekends and weekdays\r\n\r\nConditions:\r\nMovie rating and age restrictions must be adhered to at the time of voucher/ticket purchase.\r\nCan be used to book online or to be presented at the box office counter in exchange of movie ticket.\r\nReel Cinemas reserve the right to refuse admission. \r\nOutside food is not permitted.\r\nOffers cannot be used in conjunction with any other special promotions, offers, discounts, employee rewards programs, other special offerings or U by Emaar.\r\nAll standard terms and conditions for cinema admission apply. \r\nNew safety measures, https://www.reelcinemas.ae/en/covid19',	7,	'ZQrez8SPRdZeZj4F3Wmmx2i4V3rpeMdWYucIYnZn.png',	82,	'Present ID to redeem discount',	'2021-03-21 07:40:03',	1,	'2021-03-21 07:40:03',	'2021-03-21 07:40:03'),
