(245,	'20% Off Mad Hatter\'s BBQ - 2nd April!',	'The VOID are hosting a special lunch and drinks treat on the Friday 2nd April! Book a table at The Mad Hatter\'s BBQ happening at The VOID, Studio One Hotel! Alice and the gang will be there as well as children and adult face painting, a selfie station and a few more socially distanced and covid friendly surprises! \r\n\r\nThe VOID are offering 20% off to all TDG members on their lunch and house drinks packages. Normal prices are 325AED per person house beverages, 175AED per person for soft beverages and 45AED for children under 7!\r\n\r\nFor bookings, please email thevoid@studioonehotel.com.',	5,	'SVyi0u2zaE7PN8QOPFXR0WEStbKzqaiifWDWN22P.png',	71,	'Present ID to redeem discount',	'2021-03-21 01:13:42',	2,	'2021-03-21 13:13:42',	'2021-03-21 13:24:40'),
(246,	'Yoga and Meal Offer',	'Visit the VOID on a Monday and for just 89 AED you can experience socially distanced Yoga Flow with Mia in this funky outdoor venue. The price also includes a 1 course meal and 2 drinks! The class is from 6pm-7pm and you can have your drinks and dinner before or after! \r\n\r\nBooking is essential and TDG members get an extra bonus with 10 AED off the price!\r\n\r\nFor bookings, please email thevoid@studioonehotel.com.',	14,	'Q72QGp4QS5vU5MwyCSWhViviNqO0EA37xu5RbBri.png',	71,	'Present ID to redeem discount',	'2021-03-21 01:18:16',	2,	'2021-03-21 13:18:16',	'2021-03-21 13:22:26'),
(247,	'Free 15 Minutes LPG Body Contouring',	'The Contour Lounge is a ladies wellness & beauty salon that specializes in beauty treatments for the face and body using the latest technology to achieve 100% natural results. From body contouring to slimming, cellulite reduction, anti-aging and lifting, facials, skincare and fitness, they can help reach your beauty goals!\r\n\r\nThe Contour Lounge are offering a free 15 minutes LPG Body Contouring trial session to all TDG members. Advance booking recommended to avoid disappointment.\r\n\r\nOffer is valid until the end of April 2021.',	2,	'5EWXv1kRF76p6cPXhjH6O88eSoOUHE3jvtvAcYVp.jpeg',	166,	'Use code TDG TRIAL',	'2021-03-24 11:08:03',	1,	'2021-03-24 11:08:03',	'2021-03-25 07:53:11'),
(248,	'20% Off HydraFacials',	'The Contour Lounge is a ladies wellness & beauty salon that specializes in beauty treatments for the face and body using the latest technology to achieve 100% natural results. From body contouring to slimming, cellulite reduction, anti-aging and lifting, facials, skincare and fitness, they can help reach your beauty goals!\r\n\r\nThe Contour Lounge are offering 20% off HydraFacials to all TDG members. Advance booking recommended to avoid disappointment.\r\n\r\nOffer is valid until the end of April 2021.',	2,	'adjINcJLpRy0pE9JC65m7UglPUmxhYTrRXviC78H.jpeg',	166,	'Use code TDG HYDRA15',	'2021-03-24 11:13:51',	1,	'2021-03-24 11:13:51',	'2021-03-25 07:53:22'),
(249,	'Sparkle Ladies Night - Unlimited Package 123 AED',	'Located in the heart of Media City, TWENTY THREE Rooftop offers the perfect ladies night for you and your friends with a soundtrack created by \"WhatsOn best DJ 2020\", DJ Natalie Brogan. TWENTY THREE challenges the perception of luxury and exclusivity, by offering an affordable upmarket chic experience without being pretentious. \r\n\r\nTWENTY THREE Rooftop are offering a free flow drinks package for just 123 AED to all TDG members (normal price 150 AED). A selection of beverages are available including prosecco, pink gin, wines and a food platter OR only AED 99 for 4 drinks with 23% off a la carte food menu. Gents get a beer bucket deal for 123 AED too!\r\n\r\nEvery Tuesday, 8pm-1am.',	5,	'9vEB4acvGF6da7CIXZQq2pkAf9LbiAdcSDT5LdUg.png',	167,	'Present ID to redeem discount',	'2021-03-25 10:36:30',	1,	'2021-03-25 10:36:30',	'2021-03-25 10:36:30'),
(250,	'25% Off Services',	'What is the trendy, sophisticated, cosmopolitan woman looking for when it comes to style and beauty? Whatever the answer, they can provide it at Blo Out! Known simply as Blo to its stylish customers they are much more than just your average beauty salon, they will give you glamour in quick time. They know you have busy lives so will give you that stylish va va voom you are seeking without taking hours off your day. If you should feel the need for a little pampering, a bit of gossip and a friendly environment while you are getting into your second skin, there is nowhere better than Blo.\r\n\r\nBlo Out are offering 25% off to all TDG members. Valid on all regular priced services. \r\n\r\nCall the branch or WhatsApp 0525838697.',	2,	'nJ0pUsG8MhWRkQAkq0Tiunqi0NHjPseFH8fGw8SY.png',	168,	'Present ID to redeem discount',	'2021-03-25 11:37:29',	1,	'2021-03-25 11:37:29',	'2021-03-25 11:37:29'),
(251,	'25% Off Services',	'What is the trendy, sophisticated, cosmopolitan woman looking for when it comes to style and beauty? Whatever the answer, they can provide it at Blo Out! Known simply as Blo to its stylish customers they are much more than just your average beauty salon, they will give you glamour in quick time. They know you have busy lives so will give you that stylish va va voom you are seeking without taking hours off your day. If you should feel the need for a little pampering, a bit of gossip and a friendly environment while you are getting into your second skin, there is nowhere better than Blo.\r\n\r\nBlo Out are offering 25% off to all TDG members. Valid on all regular priced services.\r\n\r\nCall the branch or WhatsApp 0525838697.',	2,	'Ku3ZKRc7poufhL23B6Y8dXihlAuaeRLfhq42tmQP.png',	169,	'Present ID to redeem discount',	'2021-03-25 11:39:20',	1,	'2021-03-25 11:39:20',	'2021-03-25 11:39:20'),
(252,	'The Urban Market',	'Find your new Friday routine at The Urban Market!\r\n\r\nBoss babes That Dubai Girl have joined forces with Media One Hotel to launch The Urban Market DXB in P7 Arena starting on Friday 2nd April. A huge 30+ vendor market selling vintage clothing, home, beauty, wellness, fitness and everything in-between is open from 11am until 6pm. Early birds can enjoy free Yoga, Body Sculpt and Twerkfit classes from 11am. For those who want a later start, late lunch and drinks packages are available starting from 70 AED at 1pm onwards. Promising great vibes and a good time - Don‚Äôt miss THIS!\r\n\r\nTimings: 11:00 AM  6:00 PM\r\n\r\n Walk-ins welcome! Priority tables will be given to advance bookings.',	7,	'KUPVcaTWSnMjajMWcGRDfg6U5xrlJ5wyctUfvM2Q.png',	170,	'Free entry for all',	'2021-03-30 05:47:14',	2,	'2021-03-30 05:47:14',	'2021-03-30 05:47:41'),
(253,	'15% Off Purchases',	'Oui the Boutique is an affordable online women‚Äôs fashion brand offering outfits for all occasions, taking you from beach to brunch! \r\n\r\nYou will feel like a VIP when you receive your beautifully wrapped Oui package. Same day delivery available across Dubai and delivery to other Emirates within 72hrs.\r\n\r\nOui are offering 15% to all TDG members when ordering from the website.',	3,	'4e4D1jS4UeNqidmsu6H399q1ylwlLnDEVK575Qx1.png',	171,	'Use code OUILOVETDG15',	'2021-03-31 05:58:08',	1,	'2021-03-31 05:58:08',	'2021-03-31 07:56:48');
